import React from "react";
import CircleIcon from "@mui/icons-material/Circle";

function SliderNumber({ activeSlide, total }: any) {
  return (
    <div
      style={{
        position: "absolute",
        zIndex: 3,
        right: 6,
        top: "1px",
        fontFamily: "Arial, Helvetica, sans-serif",
        fontWeight: "bold",
      }}
    >
      <span
        style={{
          height: "200px",
          width: "20px",
          backgroundColor: "rgba(255,255,255,0.6)",
          padding: "7px",
          borderRadius: "50%",
        }}
      >
        {activeSlide + 1} <CircleIcon style={{ fontSize: "0.4vw" }} /> {total}
      </span>
    </div>
  );
}

export default SliderNumber;
